/*
    This will load a har file (JSON format) and output the urls containing the media that was downloaded
    harParser(INPUTFILE,OUTPUTFILE,MEDIA)
    example: harParser('.\library.skillport.com.har','.\files.txt','.mp4')
    this will parse that HAR file for any mp4 requests and output the media URI to the file.txt

    ***to get a har file***
    1. open the main web page in google chrome -- the page that will load the videos or whatever.
    2. pres F12 to enter developer mode and then look at the network tab.
    3. press F5 to reload and it should show you all the resources it is downloading.
    4. filter for the content to ensure it is getting what you want
    5. quickly click through each and every link on that page watching tha the resource begins to download (providing a url)
    6. right click in that list of urls and "save as HAR with content"


*/

var fs = require("fs");
module.exports = function harParser(inHAR,outCSV,media){
    try {
        //can check for file existence first
        var content = fs.readFileSync(inHAR);
        var outWrite = fs.createWriteStream(outCSV, {flags:'a'});
        var contentJSON = JSON.parse(content);
        var count = 0; //keep track of number of records
        var uurl = ''; //this will hold each url as it is investigated
        var lastUrl = ''; //this holds the last valid url -- so it can compare and not add repeated entries
        // for the HAR -- base.log.entries -- is an array of all the entries, each element of the array is an object
        //
        // base.log.entries[0].request.url should be a string -- is where the parser needs to check for the media extension
        // additionally, base.log.entries[0].response.status -- is an integer code to see if it was successful -- which can be several status codes -- perhaps only check for failure
        var entries = contentJSON.log.entries.length;
        console.log(`file in: ${inHAR}, out: ${outCSV}, media: ${media}, entries: ${entries}`)
        for(i = 0; i < entries; i++) {
            uurl = contentJSON.log.entries[i].request.url;
            if(uurl.indexOf(media) != -1 && uurl != lastUrl){
                outWrite.write(uurl + "\n");
                console.log(`found ${media}: url:${uurl}`)
                count++;                
                lastUrl = uurl;
            }
        }
        outWrite.end();
    } catch(e) {
        console.log(`error ${e}`);
        return 0;
    }
        return count;
}



